import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';

import MyToggleButton from './ToggleButton.js';
import MoveButton from './MoveButton.js';



const App = () => {
  return  (
  <div className = "parent" >
    <div style = {{  position: 'absolute', top: '30px', left: '900px'}} className = 'TwoButtons'>

      <MyToggleButton
        text = "Controls"
      />
      <MyToggleButton
        text = "History"
      />

    </div>

    <div style = {{  position: 'absolute', top: '500px', left: '900px'}} className = 'ThreeMoveButtons'>

      <MoveButton
        text = "Left"
      />
      <MoveButton
        text = "Down"
      />
      <MoveButton
        text = "Right"
      />

    </div>

    <div style= {{  position: 'absolute', top: '400px', left: '900px'}} className = 'Top'>
      <MoveButton
        text = "Top"
      />
    </div>



  </div>

  );
};


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
